import React, { Component } from 'react'
class Landing extends Component {
  constructor() {
    super();
    this.state = {
        results: []
    };
}/**/

componentDidMount(){
  fetch("http://localhost:5000/questions/showAll")
  .then(res=> res.json())
  .then(results => this.setState({results: results.post}));
}
  render() {
    return (
      <div className="container">
        <div className="jumbotron mt-5">
          <div className="col-sm-8 mx-auto">
            <h1 className="text-center">askIT</h1>
          </div>
        </div>
        <div className="row">
          <div className="col-sm-8 mx-auto">
              {
                <p>{this.state.results}</p>
              }
          </div>
        </div>
      </div>
    )
  }
}

export default Landing;
